import Accueil from './component/Accueil';
import Navbar from './component/Navbar';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Enregistrement from './component/Enresitrement';
import Liste from './component/Liste';

function App() {
  return (
    <div className="App">
        <Router>
        <Navbar/>
          <Routes>
            <Route path="/Accueil" exact element={<Accueil/>}/>
            <Route path="/Enregistrement" exact element={<Enregistrement/>}/>
            <Route path="/Liste" exact element={<Liste/>}/>
          </Routes>
        </Router>
    </div>
  );
}

export default App;
